import React from 'react';
import './data.css';
import {Box, TextField, Button} from '@mui/material';
import Snackbar, { SnackbarOrigin } from '@mui/material/Snackbar';

export default function Data() {
  const { vertical, horizontal, open } = state;

  const handleClick = (newState: SnackbarOrigin) => () => {
    setState({ open: true, ...newState });
  };


  return (
    <>
    <div className="data">
      <div className = "mdata"> 
          <h1>My Fitness Tracker</h1>
          <div> 
            <Box
      component="form"
      sx={{
        '& .MuiTextField-root': { m: 1, width: '25ch' },
      }}
      noValidate
      autoComplete="off"
    >
          <TextField required id="outlined-basic" label="Exercise Name" variant="outlined" />
          <TextField required id="outlined-basic" label="Sets" variant="outlined" />
          </Box>
          </div>

          <div>
            <Box
      component="form"
      sx={{
        '& .MuiTextField-root': { m: 1, width: '25ch' },
      }}
      noValidate
      autoComplete="off"
    >
            <TextField required id="outlined-basic" label="Reps" variant="outlined" />
            <TextField required id="outlined-basic" label="Unit" variant="outlined" />
            </Box>
            </div>

            <div>
            <Box
      component="form"
      sx={{
        '& .MuiTextField-root': { m: 1, width: '25ch' },
        
      }}
      noValidate
      autoComplete="off"
    >
              <TextField required id="outlined-basic"  label="Date" variant="outlined" />
              </Box>
              </div>
              <div>
                const button = (
                <Button variant="contained" onClick={handleClick({
          vertical: 'top',
          horizontal: 'center',
        })} >Submit</Button></div>
              
      </div>
          
        </div>
        
    </>
  )
}
